import Heart from "./Heart";

function Card(props) {
    return (
        <div>
            <Heart />
            <img src={props.url} alt={props.alt} />
            <p>{props.alt}</p>
            <button onClick={() => props.onClick()}>
                {props.isFav ? "Quitar" : "Agregar"}
            </button>
        </div>
    );
}
export default Card;
